import { CHANGE_POOLS } from '../actions';
const initialState = {
    poolsData: "Utaiba"
}
// null is set as the default value here for state, because Redux will complain if state is undefined. 
// You can set initial state here, but it is recommended on the Redux documentation to preload the state within the redux store. 
// https://redux.js.org/recipes/structuring-reducers/initializing-state
export default function submittedValueReducer(state = initialState, action) {
    switch (action.type) {
        case CHANGE_POOLS:
            return action.payload.poolsData;
        default:
            return state;
    }
}
